// src/components/Tile.js
import React from 'react';
import styled from 'styled-components';

const TileContainer = styled.div`
  width: 100%;
  height: 100%;
  background-color: ${props => props.isEmpty ? '#ddd' : '#8a2be2'};
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  font-weight: bold;
  font-size: 14px;
  cursor: pointer;
  position: relative;
`;

const Number = styled.div`
  position: absolute;
`;

const TopNumber = styled(Number)`
  top: 10px;
  left: 50%;
  transform: translateX(-50%);
`;

const LeftNumber = styled(Number)`
  left: 10px;
  bottom: 30%;
`;

const RightNumber = styled(Number)`
  right: 10px;
  bottom: 30%;
`;

const Index = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-size: 10px;
  color: rgba(255, 255, 255, 0.5);
`;

function Tile({ values, onClick, index }) {
  const isEmpty = values.every(v => v === 0);

  return (
    <TileContainer onClick={onClick} isEmpty={isEmpty}>
      <TopNumber>{values[0]}</TopNumber>
      <LeftNumber>{values[1]}</LeftNumber>
      <RightNumber>{values[2]}</RightNumber>
      <Index>{index}</Index>
    </TileContainer>
  );
}

export default Tile;
